import styled from "styled-components";
import { Link } from "react-router-dom";

export const Styleda = styled(Link)`
  font-size: 0.8rem;
  color: #3b84bb;
  font-weight: 900;
  margin-top: 15px;
  text-decoration: none;
  cursor: pointer;
`;

//Styling

export const Wrapper = styled.div`
  width: 100%;
  background-color: blue;
`;
